import React from 'react';
import './App.css';
import { Switch, Route } from 'react-router-dom';

import Home from './pages/home/Home';
import Shop from './pages/shop/Shop';

const App = () => {
   return (
      <div>
         <Switch>
            <Route exact path='/' component={Home} />
            <Route exact path='/shop' component={Shop} />
         </Switch>
      </div>
   );
};

export default App;
